    constructor(props) {
        super(props);

        this.state = {
            task: "",
            items: []
        }
    }

    componentDidMount() {
        this.getTask();
    }

    render() {
        return (
            <div>
                <div className="row">
                    <Header className="header" color="blue">To Do List App</Header>
                </div>
                <div className="row">
                    <Form action="POST" onSubmit={this.onSubmit}>
                        <Input
                        type="text"
                        name="task"
                        value={this.state.task}
                        onChange={this.taskChangeHandler}
